#def minDominoRotations(self, A: List[int], B: List[int]) -> int:
def minDominoRotations(A, B):
    print(_minDominoRotations(A, B), _minDominoRotations(B, A))
    return min(_minDominoRotations(A, B), _minDominoRotations(B, A))
def _minDominoRotations(A, B):
    res = []
    for flag in range(1,7):
        num = 0
        same = 0
        for idx in range(0, len(A)):
            same += int(A[idx] == B[idx])
            if flag == A[idx]:
                pass
            elif flag == B[idx]:
                num += 1
            else:
                num = -1
                break
        if num >= 0: res.append(num)
        print('len:%d, same=%d, res=%d' % (len(A), same, num))
    if len(res)==0: res.append(-1)
    return min(res)
    #elif num[0] < 0: return min(num[1], len(A)-num[1]-same)
    #elif num[1] < 0: return min(num[0], len(A)-num[0]-same)
    #else: return min(num[1], max(len(A)-same-num[1], 0), num[0], max(len(A)-same-num[0], 0) )

